using BackEndPartWeb.Models;
using System.Reflection.Metadata;
using Microsoft.AspNetCore.Identity;

namespace BackEndPartWeb.Data
{
    public static class DbInitializer
    {
        public static void Initialize(BestiaryContext context)
        {
            context.Database.EnsureCreated();
            if (context.Users.Any()) return;
            var roles = new Role[]
            {
                 new Role{Id = Guid.NewGuid(), Name="User"},
                 new Role{Id = Guid.NewGuid(), Name="Admin"},
                 new Role{Id = Guid.NewGuid(), Name="Super Admin"}
            };
            var clasifications = new Clasification[]
            {
                new Clasification{Id = Guid.NewGuid(),Name ="Cursed"},
                new Clasification{Id = Guid.NewGuid(),Name ="Elementa"},
            };
            var userImage = new Image { Id = Guid.Parse("e66f1dba-0be2-4b81-a085-fd2a0ca1b7d5"), Name = "Default.jpg", Content= "data:image/jpeg;base64," };
            var users = new User[]
            {
                new User{Id = Guid.NewGuid(),Username="moder",
                    FullName="Maksym Moroz", Age=20, Email="maks@gmail.com",
                    Role=roles[2], Image = userImage},
                new User{Id = Guid.NewGuid(),Username="admin",
                    FullName="Danylo Shalak", Age=21, Email="danila@gmail.com",
                    Role=roles[1], Image = userImage},
                new User{Id = Guid.NewGuid(),Username="user",
                    FullName="Bruce Wayne", Age=30, Email="batman@gmail.com",
                    Role=roles[0], Image = userImage}
            };
            PasswordHasher<User> passwordHasher = new PasswordHasher<User>();
            var passwords = new string[]
            {
                passwordHasher.HashPassword(users[0],"password"),
                passwordHasher.HashPassword(users[1],"password"),
                passwordHasher.HashPassword(users[2],"password"),
            };
            for (int i = 0; i < users.Length; i++)
            {
                users[i].Password = passwords[i];
            }
            var golemImage = new Image { Id = Guid.Parse("af15701d-fed6-4395-91dd-226cbe2b2d7a"), Name = "Golem.png", Content= "data:image/png;base64," };
            var ulfhedinnImage = new Image { Id = Guid.Parse("1a076a61-9f2d-42c5-8fb7-6b6adcfe219b"), Name = "Ulfhedinn.png", Content = "data:image/png;base64," };
            var monsters = new Monster[]
            {
                new Monster{Id = Guid.NewGuid(),Name = "Golem", Clasification =clasifications[1], Image=golemImage,Description="Golems are mindless matter brought to life by a spell. They obey their creator's orders without question. " +
                "Their boundless strength, ability to withstand pain, endless patience and the fact that they neet not one jot of food or drink makes them the best servants or guards anyone could ask for." +
                " Once provoked, they will not tire of battle until they have either crushed their opponent or themselves crumbled to dust.Defeating a golem is extraordinarily difficult: for obvious reasons it does not bleed, it feels no fear or mercy and it is invulnerable to fire and poison." +
                " What's more, a golem's body is as hard as the rock it is sometimes heft out of, so even a silver blade will barely wound it. The monster's only weakness is acid – a blade covered in acrid oil can thus increase one's chances for victory." +
                "Golems use no weapons, for they have no need – their fists, weighing over a hundred pounds each, can crush solid granite with one hit. A blow from a golem should thus be avoided at all costs – there is no shield that can stop it, nor sword that can parry it." +
                " That is no easy task, for these creatures are able to move with surprising speed. Luckily, their enormous mass means they are not very agile – once a golem begins a charge, it cannot stop quickly, a fact experienced witchers use to their advantage." },


                new Monster{Id = Guid.NewGuid(),Name="Ulfhedinn",Clasification =clasifications[0], Image=ulfhedinnImage, Description="Ulfhedinn are a breed of werewolf found mainly in Skellige. The harsh and barren conditions of the isles might explain why they primarily hunt men and are stronger than their continental brethren. Older and particularly dangerous ulfhedinn are called vorefs." +
                " Only a few daring warriors in Skellige history have managed to defeat an ulfhedinn, and each of them is commemorated in ballads as a hero to this day.Like werewolves, ulfhedinn and vorefs are active at night, particularly when the moon is at its fullest. Fast, strong, and amazingly resilient, these creatures kill with disturbing ease. " +
                "Silver blades should be brought against them, as should Devil's Puffball. Take note that when near death the ulfhedinn becomes particularly dangerous and will attack with doubled fury, while calling on wolves to come to its rescue."}
            };
            context.AddRange(roles);
            context.SaveChanges();
            context.AddRange(monsters);
            context.SaveChanges();
            context.AddRange(users);
            context.SaveChanges();
        }
    }
}
